import React, { useState } from 'react';
import AITestingTools from '../components/AITestingTools';

function AIEnhancedPage() {
  const [showTestingTools, setShowTestingTools] = useState(false);

  const toggleTestingTools = () => {
    setShowTestingTools(!showTestingTools);
  };

  return (
    <div className="ai-enhanced-page">
      <h1>AI赋能</h1>
      <button onClick={toggleTestingTools}>
        {showTestingTools ? '隐藏AI测试工具' : '显示AI测试工具'}
      </button>
      {showTestingTools ? (
        <AITestingTools />
      ) : (
        <div>
          {/* 原有的AI赋能页面内容 */}
          <p>这里是AI赋能页面的原有内容...</p>
        </div>
      )}
    </div>
  );
}

export default AIEnhancedPage;
